import "./Signupbox.css";
import Signupform from "./Signupform";

function Signupbox() {
  return (
    <div>
    <div className="img"></div>
    <div className="outline">
      <div className="sign">
        <h2>Create an account</h2>
      </div>
      <Signupform></Signupform>
    </div>
    </div>
  );
}

export default Signupbox;
